import React from "react";
import { Nav, Navbar, NavItem } from "react-bootstrap";

import "../Header/Header.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link, NavLink } from "react-router-dom";

class Header extends React.Component {
  state = {
    email: "",
    password: "",
    navigate: false,
    succesfulLogout: false,
  };

  handleLogOut = async (event) => {
    try {
      await localStorage.clear("jwt");
      // TODO: remove user from state.
      this.props.setUser("");

      console.log("here");
    } catch (err) {
      console.log(err);
    }
  };

  render() {
    return (
      <Navbar collapseOnSelect expand="md" className="color-nav" fixed="top">
        <div>
          {this.props.user ? (
            <>
              <Nav pullRight className="mr-auto">
                <Navbar.Toggle aria-controls="responsive-navbar-nav " />

                <Navbar.Collapse
                  id="responsive-navbar-nav "
                  // className="justify-content-end"
                >
                  <NavItem>
                    <NavLink to="/" activeClassName="active">
                      <span className="Nav-Item">All Spots</span>
                    </NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink to="/mySpots" activeClassName="active">
                      <span className="Nav-Item">My Spots</span>
                    </NavLink>
                  </NavItem>
                  <NavItem>
                    <NavLink to="/createSpot" activeClassName="active">
                      <span className="Nav-Item">Creat Spot</span>
                    </NavLink>
                  </NavItem>
                </Navbar.Collapse>
              </Nav>

              <NavLink
                to="/logIn"
                activeClassName="active"
                onClick={this.handleLogOut}
              >
                <span className="signUp">Logout</span>
              </NavLink>
              <NavLink to="/account" activeClassName="active">
                <span className="signUp">Account</span>
              </NavLink>
            </>
          ) : (
            <>
              <NavLink to="/signUp" activeClassName="active">
                <span className="signUp">Signup</span>
              </NavLink>
              <NavLink to="/logIn" activeClassName="active">
                <span className="logIn">Login</span>
              </NavLink>
            </>
          )}
        </div>
      </Navbar>
    );
  }
}
export default Header;
